import React from "react";
import styled from "styled-components";

const StyledTipSubmissions = styled.div`
  background-color: #f9f7f1;
  display: flex;
  flex-direction: row;
  justify-content: center;
  width: 100%;

  & .overlap-wrapper {
    background-color: #f9f7f1;
    height: 817.91px;
    overflow: hidden;
    width: 377.73px;
  }

  & .overlap {
    height: 904px;
    position: relative;
    top: -86px;
    width: 689px;
  }

  & .post {
    height: 261px;
    left: 22px;
    position: absolute;
    top: 610px;
    width: 336px;
  }

  & .overlap-group {
    height: 261px;
    position: relative;
    width: 334px;
  }

  & .div {
    background-color: #ffffff;
    border-radius: 10.07px;
    box-shadow: 0px 0px 40.29px #0000001a;
    height: 122px;
    left: 0;
    position: absolute;
    top: 139px;
    width: 333px;
  }

  & .image {
    height: 146px;
    left: 0;
    object-fit: cover;
    position: absolute;
    top: 0;
    width: 333px;
  }

  & .businesses-sell {
    height: 15px;
    left: 16px;
    position: absolute;
    top: 165px;
    width: 297px;
  }

  & .post-info {
    height: 42px;
    left: 10px;
    position: absolute;
    top: 190px;
    width: 304px;
  }

  & .save-like {
    height: 34px;
    left: 246px;
    position: absolute;
    top: 8px;
    width: 60px;
  }

  & .vector {
    height: 17px;
    left: -1px;
    position: absolute;
    top: 1px;
    width: 14px;
  }

  & .overlap-group-2 {
    height: 34px;
    left: 36px;
    position: absolute;
    top: 0;
    width: 22px;
  }

  & .group {
    background-image: url(./valentines-heart.png);
    background-size: 100% 100%;
    height: 19px;
    left: 2px;
    position: absolute;
    top: 0;
    width: 19px;
  }

  & .text-wrapper {
    color: #a1a8b9;
    font-family: "Inter-Medium", Helvetica;
    font-size: 12.1px;
    font-weight: 500;
    left: 0;
    letter-spacing: 0;
    line-height: normal;
    position: absolute;
    top: 19px;
  }

  & .OP {
    height: 29px;
    left: 37px;
    position: absolute;
    top: 3px;
    width: 63px;
  }

  & .group-2 {
    height: 29px;
    position: relative;
    width: 67px;
  }

  & .taylor-swift {
    height: 11px;
    left: 0;
    position: absolute;
    top: 3px;
    width: 61px;
  }

  & .p {
    color: #a1a8b9;
    font-family: "Inter-Medium", Helvetica;
    font-size: 9.4px;
    font-weight: 500;
    left: 0;
    letter-spacing: 0;
    line-height: normal;
    position: absolute;
    top: 17px;
  }

  & .TS-pfp {
    height: 34px;
    left: 0;
    object-fit: cover;
    position: absolute;
    top: 0;
    width: 34px;
  }

  & .overlap-group-wrapper {
    height: 261px;
    left: 22px;
    position: absolute;
    top: 324px;
    width: 336px;
  }

  & .save-like-2 {
    height: 34px;
    left: 261px;
    position: absolute;
    top: 222px;
    width: 60px;
  }

  & .img {
    height: 19px;
    left: 2px;
    position: absolute;
    top: 0;
    width: 19px;
  }

  & .OP-2 {
    height: 29px;
    left: 15px;
    position: absolute;
    top: 217px;
    width: 104px;
  }

  & .ellipse {
    height: 29px;
    left: 0;
    object-fit: cover;
    position: absolute;
    top: 0;
    width: 29px;
  }

  & .group-3 {
    height: 29px;
    left: 37px;
    position: absolute;
    top: 0;
    width: 71px;
  }

  & .text-wrapper-2 {
    color: #505050;
    font-family: "Inter-Medium", Helvetica;
    font-size: 11px;
    font-weight: 500;
    left: 0;
    letter-spacing: 0;
    line-height: normal;
    position: absolute;
    top: 0;
  }

  & .image-2 {
    height: 146px;
    left: 0;
    position: absolute;
    top: 0;
    width: 333px;
  }

  & .flexcontainer {
    align-items: flex-start;
    display: flex;
    flex-direction: column;
    gap: 1.01px;
    height: 38px;
    left: 15px;
    position: absolute;
    top: 161px;
    width: 308px;
  }

  & .text {
    align-self: stretch;
    color: #364459;
    font-family: "Inter-Medium", Helvetica;
    font-size: 15.1px;
    font-weight: 500;
    letter-spacing: 0;
    line-height: 18.5px;
    position: relative;
  }

  & .span {
    color: #364459;
    font-family: "Inter-Medium", Helvetica;
    font-size: 15.1px;
    font-weight: 500;
    letter-spacing: 0;
    line-height: 18.5px;
  }

  & .share-tip-button {
    height: 50px;
    left: 72px;
    position: absolute;
    top: 308px;
    width: 238px;
  }

  & .tip-section-header {
    height: 278px;
    left: 0;
    position: absolute;
    top: 0;
    width: 689px;
  }

  & .overlap-2 {
    height: 278px;
    position: relative;
    width: 683px;
  }

  & .rectangle {
    background-color: #c7e786;
    height: 182px;
    left: 0;
    position: absolute;
    top: 87px;
    width: 378px;
  }

  & .ellipse-2 {
    background-color: #ffffff26;
    border-radius: 102.74px;
    height: 205px;
    left: 209px;
    position: absolute;
    top: 0;
    width: 205px;
  }

  & .ellipse-3 {
    background-color: #ffffff26;
    border-radius: 62.45px;
    height: 125px;
    left: 302px;
    position: absolute;
    top: 153px;
    width: 125px;
  }

  & .text-wrapper-3 {
    color: #364459;
    font-family: "Inter-Medium", Helvetica;
    font-size: 9.4px;
    font-weight: 500;
    left: 29px;
    letter-spacing: 0;
    line-height: normal;
    position: absolute;
    top: 229px;
  }

  & .tip-submissions-back {
    color: #ffffff26;
    font-family: "Inter-Medium", Helvetica;
    font-size: 67.5px;
    font-weight: 500;
    left: 154px;
    letter-spacing: 0;
    line-height: normal;
    position: absolute;
    top: 193px;
  }

  & .text-wrapper-4 {
    color: #364459;
    font-family: "Inter-Medium", Helvetica;
    font-size: 30.2px;
    font-weight: 500;
    left: 23px;
    letter-spacing: 0;
    line-height: normal;
    position: absolute;
    top: 191px;
    width: 237px;
  }

  & .back-arrow {
    height: 24px;
    left: 23px;
    position: absolute;
    top: 148px;
    width: 24px;
  }

  & .element-dots {
    height: 22px;
    left: 351px;
    position: absolute;
    top: 149px;
    width: 4px;
  }

  & .ellipse-4 {
    background-color: #364459;
    border-radius: 2.01px;
    height: 4px;
    left: 0;
    position: absolute;
    top: 0;
    width: 4px;
  }

  & .ellipse-5 {
    background-color: #364459;
    border-radius: 2.01px;
    height: 4px;
    left: 0;
    position: absolute;
    top: 9px;
    width: 4px;
  }

  & .ellipse-6 {
    background-color: #364459;
    border-radius: 2.01px;
    height: 4px;
    left: 0;
    position: absolute;
    top: 18px;
    width: 4px;
  }

  & .tip-search-bar {
    height: 50px;
    left: 22px;
    position: absolute;
    top: 243px;
    width: 335px;
  }

  & .overlap-3 {
    background-color: #ffffff;
    border-radius: 90.66px;
    box-shadow: 3.02px 5.04px 20.15px #b5b5b526;
    height: 50px;
    position: relative;
    width: 333px;
  }

  & .text-wrapper-5 {
    color: #d2d2d2;
    font-family: "Inter-Medium", Helvetica;
    font-size: 14.1px;
    font-weight: 500;
    left: 50px;
    letter-spacing: 0;
    line-height: normal;
    position: absolute;
    top: 17px;
  }

  & .div-wrapper {
    height: 14px;
    left: 25px;
    position: absolute;
    top: 18px;
    width: 13px;
  }

  & .overlap-group-3 {
    height: 14px;
    position: relative;
  }

  & .ellipse-7 {
    border: 1.71px solid;
    border-color: #d2d2d2;
    border-radius: 5.87px/5.82px;
    height: 12px;
    left: 0;
    position: absolute;
    top: 0;
    transform: rotate(-4.72deg);
    width: 12px;
  }

  & .rectangle-2 {
    background-color: #d2d2d2;
    border-radius: 3.02px;
    height: 5px;
    left: 10px;
    position: absolute;
    top: 9px;
    transform: rotate(-46.67deg);
    width: 2px;
  }

  & .app-tabs-tips {
    height: 818px;
    left: 0;
    position: absolute;
    top: 86px;
    width: 378px;
  }
`;

export const Tips_Home = () => {
  return (
    <StyledTipSubmissions>
      <div className="overlap-wrapper">
        <div className="overlap">
          <div className="post">
            <div className="overlap-group">
              <div className="div" />
              <img className="image" alt="Image" src="image-2.png" />
              <img
                className="businesses-sell"
                alt="Businesses sell"
                src="businesses-sell-bubble-tea-in-paper-cups.png"
              />
              <div className="post-info">
                <div className="save-like">
                  <img className="vector" alt="Vector" src="vector-2.png" />
                  <div className="overlap-group-2">
                    <div className="group" />
                    <div className="text-wrapper">109</div>
                  </div>
                </div>
                <div className="OP">
                  <div className="group-2">
                    <img className="taylor-swift" alt="Taylor swift" src="taylor-swift.png" />
                    <p className="p">2019 . 01 . 01</p>
                  </div>
                </div>
                <img className="TS-pfp" alt="Ts pfp" src="TS-pfp.png" />
              </div>
            </div>
          </div>
          <div className="overlap-group-wrapper">
            <div className="overlap-group">
              <div className="div" />
              <div className="save-like-2">
                <img className="vector" alt="Vector" src="vector-2.svg" />
                <div className="overlap-group-2">
                  <img className="img" alt="Group" src="group-3-5.png" />
                  <div className="text-wrapper">109</div>
                </div>
              </div>
              <div className="OP-2">
                <img className="ellipse" alt="Ellipse" src="ellipse-3.png" />
                <div className="group-3">
                  <div className="text-wrapper-2">Shylla Monic</div>
                  <p className="p">2023 . 04 . 06</p>
                </div>
              </div>
              <img className="image-2" alt="Image" src="image-1.png" />
              <div className="flexcontainer">
                <p className="text">
                  <span className="span">
                    Grow your own fruits and veggies to avoid <br />
                  </span>
                </p>
                <p className="text">
                  <span className="span">buying plastic packaging</span>
                </p>
              </div>
            </div>
          </div>
          <img className="share-tip-button" alt="Share tip button" src="share-tip-button.png" />
          <div className="tip-section-header">
            <div className="overlap-2">
              <div className="rectangle" />
              <div className="ellipse-2" />
              <div className="ellipse-3" />
              <p className="text-wrapper-3">Vote for your favorite to be the tip of the day or submit your own!</p>
              <div className="tip-submissions-back">Tip Submissions</div>
              <div className="text-wrapper-4">Tip Submissions</div>
              <img className="back-arrow" alt="Back arrow" src="back-arrow.png" />
              <div className="element-dots">
                <div className="ellipse-4" />
                <div className="ellipse-5" />
                <div className="ellipse-6" />
              </div>
            </div>
          </div>
          <div className="tip-search-bar">
            <div className="overlap-3">
              <div className="text-wrapper-5">Search For Tips</div>
              <div className="div-wrapper">
                <div className="overlap-group-3">
                  <div className="ellipse-7" />
                  <div className="rectangle-2" />
                </div>
              </div>
            </div>
          </div>
          <img className="app-tabs-tips" alt="App tabs tips" src="app-tabs-tips.png" />
        </div>
      </div>
    </StyledTipSubmissions>
  );
};
